rting quarterback until later in the week following news that Drew Brees (ribs) is out 2-to-3 weeks, Katherine Terrell of The Athletic reports.\",\"analysis\":\"It's a two-man race between Winston and Taysom Hill, and both quarterbacks likely will handle first-team reps in practice this week before Payton names a starter. Winston was mediocre in place of Brees in Sunday's win over San Francisco; he completed six of 10 passes for 63 yards. Hill was up to his usual tricks, piling up 45 yards on eight carries but didn't attempt a pass. This Sunday's matchup against the Falcons' last-ranked pass defense would be an ideal opportunity for Winston to showcase his skills for the Saints and other teams who could be interested in his services next season, and he'll be an intriguing fantasy streamer if that's the case.\",\"title\":\"Could start Week 11\"},{\"timeEpochMilli\":\"1605653892000\",\"contents\":\"BALLER MOVE: Add in 2QB LeaguesROSTERED: 1% of LeaguesANALYSIS: Drew Brees has several broken ribs and a collapsed lung. I am no doctor, but that sounds like it could be an issue over the next few weeks or so, and that means that Jameis Winston is going to be taking the wheel for New Orleans in an opportunity to parlay a limited stint as the Saints' starter into a worthwhile contract somewhere for next season. Winston made a split-second showing in the Saints' Week Nine pummeling of the ...\",\"url\":\"https://www.rotoballer.com/jameis-winston-qb-no-week-11-waiver-wire-pickups/804785\",\"title\":\"Jameis Winston (QB, NO) - Week 11 Waiver Wire Pickups\"}],\"nameFirst\":\"Jameis\",\"nameLast\":\"Winston\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"NO\",\"location\":\"New Orleans\",\"name\":\"Saints\"},\"externalIds\":[{\"id\":\"fb3b36fc-b985-4807-8199-d038d7e62a93\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6304,\"away\":{\"abbreviation\":\"ATL\",\"location\":\"Atlanta\",\"name\":\"Falcons\"},\"home\":{\"abbreviation\":\"N