cond-most rushing yards per game thus far.\",\"title\":\"Tops 100 scrimmage yards\"},{\"timeEpochMilli\":\"1605818743000\",\"contents\":\"Minnesota Vikings running back Dalvin Cook will look to shred a Cowboys Defensein Week 11 that has allowed the 17th-fewest fantasy points to opposing backs this season. Cook was \\\"held\\\" to 96 rushing yards on 30 carries last week against the Bears, but he should have more room to roam against Dallas. Cook is only 46 yards shy of 1,000 for the season and is primed to post RB1 numbers against a Cowboys team that has allowed 18-plus fantasy points to four different running backs this season. Cook ...\",\"url\":\"https://www.rotoballer.com/player-news/dalvin-cook-hungry-to-get-back-on-track/805951\",\"title\":\"Dalvin Cook Hungry To Get Back On Track\"}],\"nameFirst\":\"Dalvin\",\"nameLast\":\"Cook\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"MIN\",\"location\":\"Minnesota\",\"name\":\"Vikings\"},\"externalIds\":[{\"id\":\"8960d61e-433b-41ea-a7ad-4e76be87b582\"}],\"positionEligibility\":[\"RB\"]},\"requestedGames\":[{\"game\":{\"id\":6309,\"away\":{\"abbreviation\":\"DAL\",\"location\":\"Dallas\",\"name\":\"Cowboys\"},\"home\":{\"abbreviation\":\"MIN\",\"location\":\"Minnesota\",\"name\":\"Vikings\"},\"startTimeEpochMilli\":\"1606080300000\",\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true}},\"stats\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\"nameSingular\":\"Rushing Yard\",\"namePlural\":\"Rushing Yards\"}},{\"category\":{\"id\":175,\"abbreviation\":\"Rec\",\"nameSingular\":\"Target % Caught\",\"namePlural\":\"Target % Caught\"}},{\"category\":{\"id\":42,\"abbreviation\":\"Yd\",\"nameSingular\":\"Receiving Yard\",\"namePlural\":\"Receiving Yards\"}},{\"category\":{\"id\":29,\"abbreviation\":\"TD\",\"nameSingular\":\"Offensive + Special Teams TD\",\"namePlural\":\"Offensive + Special Teams TDs\"}}],\"statsProjected\":[{\"category\":{\"id\":22,\"abbreviation\":\"Yd\",\