n't fared well against pressure in 2020. Per Pro Football Focus, he ranks 38th with a 30.8 rating against pressure. Part of the problem is Mayfield holds the ball too long and spends too much time in the pocket. He's 38th in the NFL in average time to throw (2.83 seconds) and pocket time (3.01). One more challenge for the Browns' quarterback is starting right tackle Jack Conklin being placed on the reserved/COVID-19 list. The obvious workaround for the Browns, who rank fourth in rushing, is putting the ball in the hands of running backs Nick Chubb and Kareem Hunt against Philadelphia's 26th-ranked run defense.\",\"title\":\"Challenges entering Week 11\"},{\"timeEpochMilli\":\"1605753182000\",\"contents\":\"Cleveland Browns quarterback Baker Mayfield draws an encouraging matchup against the Philadelphia Eagles at home in Week 11. Philadelphia's pass defense has struggled this season, ranking 21st in DVOA. Whether Mayfield is able to take advantage of this plus matchup is another story, however. Mayfield has not thrown a touchdown since tossing five scores back in Week 7 against the Cincinnati Bengals, spanning two games. Cleveland has deployed a run-heavy approach on offense this season, which has...\",\"url\":\"https://www.rotoballer.com/player-news/baker-mayfield-a-qb2-in-week-11/805670\",\"title\":\"Baker Mayfield A QB2 In Week 11\"}],\"nameFirst\":\"Baker\",\"nameLast\":\"Mayfield\",\"hasLockedPremiumContent\":true,\"proTeam\":{\"abbreviation\":\"CLE\",\"location\":\"Cleveland\",\"name\":\"Browns\"},\"externalIds\":[{\"id\":\"30198d30-9769-4e10-ac86-b4c91d940802\"}],\"positionEligibility\":[\"QB\"]},\"requestedGames\":[{\"game\":{\"id\":6303,\"away\":{\"abbreviation\":\"PHI\",\"location\":\"Philadelphia\",\"name\":\"Eagles\"},\"home\":{\"abbreviation\":\"CLE\",\"location\":\"Cleveland\",\"name\":\"Browns\"},\"startTimeEpochMilli\":\"1606068000000\",\"period\":{\"ordinal\":11,\"startEpochMilli\":\"1605610800000\",\"isNow\":true}},\"stats\":[{\"category\":{\"id\":1